	public void solve(char[][] board) {
        // Start typing your Java solution below
        // DO NOT write main() function
		if(board == null || board.length == 0){
			return;
		}
        int[][] found = new int[board.length][board[0].length];
        
        for(int i = 0;i<board[0].length;i++){
        	found[0][i] = 1;
        }
        for(int i = 0;i<board[0].length;i++){
        	found[board.length-1][i] = 1;
        }
        for(int i = 0;i<board.length;i++){
        	found[i][0] = 1;
        }
        for(int i = 0;i<board.length;i++){
        	found[i][board[0].length-1] = 1;
        }
        
        scanO(board,found);
        for(int i = 0;i<board.length;i++){
        	for(int j = 0;j<board[0].length;j++){
        		if(found[i][j] == 0){
        			board[i][j] = 'X';
        			found[i][j] = 1;
        		}
        	}
        }
    }
	
	private void scanO(char[][] board,int[][] found){
		for(int i = 0;i<board.length;i++){
			for(int j = 0;j<board[0].length;j++){
				if(found[i][j] == 0 && board[i][j] == 'O'){
					if(board[i-1][j] == 'O' && found[i-1][j] == 1){
						found[i][j] = 1;
						board[i][j] = 'O'; 
					}
				}
			}
		}
		for(int i = board.length-1;i>=0;i--){
			for(int j = 0;j<board[0].length;j++){
				if(found[i][j] == 0 && board[i][j] == 'O'){
					if(board[i+1][j] == 'O' && found[i+1][j] == 1){
						found[i][j] = 1;
						board[i][j] = 'O'; 
					}
				}
			}
		}
		
		for(int i = 0;i<board[0].length;i++){
			for(int j = 0;j<board.length;j++){
				if(found[j][i] == 0 && board[j][i] == 'O'){
					if(board[j][i-1] == 'O'  && found[j][i-1] == 1){
						found[j][i] = 1;
						board[j][i] = 'O';
					}
				}
			}
		}
		
		for(int i = board[0].length-1;i>=0;i--){
			for(int j = 0;j<board.length;j++){
				if(found[j][i] == 0 && board[j][i] == 'O'){
					if(board[j][i+1] == 'O'  && found[j][i+1] == 1){
						found[j][i] = 1;
						board[j][i] = 'O';
					}
				}
			}
		}
		
	}
	
	public void solveDFS(char[][] board){
		if(board == null || board.length == 0){
			return;
		}
        int[][] found = new int[board.length][board[0].length];
        
        Stack<Point> stack = new Stack<Point>();
        for(int i = 0;i<board[0].length;i++){
        	if(board[0][i] == 'O' && found[0][i] == 0){
        		stack.add(new Point(0,i));
        		dfs(board,found,stack);
        	}
        	found[0][i] = 1;
        	if(board[board.length-1][i] == 'O' && found[board.length-1][i] == 0){
        		stack.add(new Point(board.length-1,i));
        		dfs(board,found,stack);
        	}
        	found[board.length-1][i] = 1;
        }
        for(int i = 0;i<board.length;i++){
        	if(board[i][0] == 'O' && found[i][0] == 0){
        		stack.add(new Point(i,0));
        		dfs(board,found,stack);
        	}
        	found[i][0] = 1;
        	if(board[i][board[0].length-1] == 'O' && found[i][board[0].length-1] == 0){
        		stack.add(new Point(i,board[0].length-1));
        		dfs(board,found,stack);
        	}
        	found[i][board[0].length-1] = 1;
        }
        
        for(int i = 0;i<board.length;i++){
        	for(int j = 0;j<board[0].length;j++){
        		if(found[i][j] == 0 && board[i][j] == 'O'){
        			board[i][j] = 'X';
        			found[i][j] = 1;
        		}
        	}
        }
	}
	
	private void dfs(char[][] board,int[][] found,Stack<Point> stack){
		while(!stack.isEmpty()){
			Point point = stack.pop();
			
			if(point.getY() != 0 && found[point.getX()][point.getY()-1] == 0){
				if(board[point.getX()][point.getY()-1] == 'O'){
					stack.add(new Point(point.getX(),point.getY()-1));
				}
				found[point.getX()][point.getY()-1] = 1;
			}
			
			if(point.getY() != board.length-1 && found[point.getX()][point.getY()+1] == 0){
				if(board[point.getX()][point.getY()+1] == 'O'){
					stack.add(new Point(point.getX(),point.getY()+1));
				}
				found[point.getX()][point.getY()+1] = 1;
			}
			
			if(point.getX() != 0 && found[point.getX()-1][point.getY()] == 0){
				if(board[point.getX()-1][point.getY()] == 'O'){
					stack.add(new Point(point.getX()-1,point.getY()));
				}
				found[point.getX()-1][point.getY()] = 1;
			}
			
			if(point.getX() != board[0].length-1 && found[point.getX()+1][point.getY()] == 0){
				if(board[point.getX()+1][point.getY()] == 'O'){
					stack.add(new Point(point.getX()+1,point.getY()));
				}
				found[point.getX()+1][point.getY()] = 1;
			}
		}
	}
